import React from 'react';
import {Link} from 'react-router-dom';

const Navbar = ()=>{
    return (
        <>
        <div className='list'>
        <h1>Wether App</h1>
        <ul>
            <li><Link to='/home'>Home</Link></li>
            <li><Link to='/search'>Search</Link></li>
        </ul> 
        </div>
        </>
    );
}

export default Navbar;
